import React, { Fragment } from 'react'

export default function ProjectModal(props) {

    const {
        description,
        frontend,
        backend,
        technologies,
        projectInfo
    } = props.projectInfo;
    return (
        <Fragment>
            <div>{props.projectInfo.description}</div>
            <div>Frontend: {props.projectInfo.frontend}</div><br></br>
            <div>Backend: {props.projectInfo.backend}</div><br></br>
            <div>Technologies: {props.projectInfo.technologies}</div><br></br>
            <div><a href={props.projectInfo.url}>Go to demo</a></div><br></br>
        </Fragment>
    )
}
